import React from 'react';
import Panel from './Panel';


const PanelList = ({ pokedex }) => {
    // const justOne = []
    // const prePanel = pokedex.map(arry => { 
    //     for(let i = 0; i < arry.length; i++){
    //         justOne.push(arry[i])
    //     }
    // })

    const prePanel = pokedex.map(function(ele){
        return ele
    })

    // console.log(justOne)
    console.log(prePanel)

    const PanelCompon = pokedex.map((pokemon, i) => {

        return <Panel id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })
    return (
        <div>
            {PanelCompon}
        </div>
    );
}

export default PanelList;
